  themes = ['neutral', 'purple', 'yellow']
  [theme, setTheme] = useState('neutral')
  return (
  <div className='flex-1 flex-col justify-items-center max-h-full'>
    <TopBar/>
    <div className='flex flex-row  items-center'>
    <img src={banner} alt='banner' className='my-5'/>
    <Companies/>
    </div>
  </div>  );
}

export default App;
